function quote (text) {
    return "\"" + text + "\"";
}

function runQuietly (shellObj, command) {
    return shellObj.Run(command, 0, true);
}

function forceDeletion (fileSysObj, filename) {
    fileSysObj.DeleteFile(filename, true);
}

function inArray (items, item) {
    var length = items.length;
    for (var k = 0; k < length; ++k) {
        if (item === items[k]) {
            return true;
        }
    }

    return false;
}

function dumpFileAsAscii (fileSysObj, filename, data) {
    fileSysObj.CreateTextFile(filename, true, false);
    var textStream = fileSysObj.GetFile(filename).OpenAsTextStream(2, 0);

    textStream.Write(data);
    textStream.Close();
}

